import React, { useState } from "react";
import { FaInstagram, FaLinkedin } from "react-icons/fa";

export default function Quote() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    company: "",
    product: "",
    details: ""
  });

  const [status, setStatus] = useState("");

  const handleChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setStatus("Sending...");

    try {
      const response = await fetch("/api/send-email", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify(formData)
      });

      if (response.ok) {
        setStatus("Request sent successfully!");
        setFormData({ name: "", email: "", company: "", product: "", details: "" });
      } else {
        setStatus("Something went wrong. Try again.");
      }
    } catch (err) {
      console.error(err);
      setStatus("Network error.");
    }
  };

  return (
    <div className="min-h-screen bg-gray-100 text-gray-900">
      {/* ðŸ”¹ Top Nav Bar */}
      <div className="w-full bg-gray-900 text-white flex items-center justify-between px-40 py-4 fixed top-0 z-50 shadow-md">
        <div className="text-sm font-bold uppercase">
          <a href="/" className="hover:underline text-orange-400">Home</a>
        </div>
        <div className="flex-1 flex justify-center space-x-10 font-bold text-base uppercase">
          <a href="/products" className="hover:text-orange-400">Our Products</a>
          <a href="/#contact" className="hover:underline">Contact Us</a>
          <a href="/quote" className="hover:underline text-orange-400">Request a Quote</a>
        </div>
        <div className="w-1/4 flex justify-end">
          <img src="/Jendyco-Logo2.png" alt="Jendyco Logo" className="w-40 h-auto drop-shadow-[0_0_8px_white]" />
        </div>
      </div>

      {/* ðŸ”¸ Main Section */}
      <div className="pt-52 px-6 md:px-40 py-16 bg-white">
        <h1 className="text-4xl font-bold text-center text-[#002b5c] mb-10">Request a Quote</h1>
        <p className="text-center text-gray-700 max-w-xl mx-auto mb-12">
          Share your needs for coffee, cacao, or cargo. Weâ€™ll respond within 24â€“48 hours with a custom quote.
        </p>

        {/* ðŸ”½ Form */}
        <form onSubmit={handleSubmit} className="grid grid-cols-1 md:grid-cols-2 gap-6 text-sm text-gray-800">
          <div className="flex flex-col">
            <label className="mb-1 font-medium">Full Name</label>
            <input type="text" name="name" value={formData.name} onChange={handleChange} className="p-3 rounded border border-gray-300" required />
          </div>

          <div className="flex flex-col">
            <label className="mb-1 font-medium">Email Address</label>
            <input type="email" name="email" value={formData.email} onChange={handleChange} className="p-3 rounded border border-gray-300" required />
          </div>

          <div className="flex flex-col md:col-span-2">
            <label className="mb-1 font-medium">Company Name</label>
            <input type="text" name="company" value={formData.company} onChange={handleChange} className="p-3 rounded border border-gray-300" />
          </div>

          <div className="flex flex-col md:col-span-2">
            <label className="mb-1 font-medium">Product of Interest</label>
            <select name="product" value={formData.product} onChange={handleChange} className="p-3 rounded border border-gray-300">
              <option>Arabica Coffee Beans</option>
              <option>Cacao Beans</option>
              <option>Pima Cotton</option>
              <option>Mixed Shipment</option>
              <option>Other / Custom</option>
            </select>
          </div>

          <div className="flex flex-col md:col-span-2">
            <label className="mb-1 font-medium">Additional Details</label>
            <textarea name="details" rows="5" value={formData.details} onChange={handleChange} className="p-3 rounded border border-gray-300" placeholder="Volume, timeline, delivery port, certifications..." />
          </div>

          <div className="md:col-span-2 text-center mt-6">
            <button type="submit" className="bg-[#ff6f00] hover:bg-orange-600 text-white font-bold px-8 py-3 rounded shadow transition">
              Submit Request
            </button>
            {status && <p className="mt-4 text-sm text-gray-700">{status}</p>}
          </div>
        </form>
      </div>

      {/* ðŸ”» Footer with Socials */}
      <footer className="bg-gray-200 text-center py-8 text-sm text-gray-600">
        <div className="mb-4 flex justify-center gap-6">
          <a href="https://www.instagram.com/jendyco_international" target="_blank" rel="noopener noreferrer" aria-label="Instagram">
            <FaInstagram className="text-[#E1306C] text-2xl hover:scale-110 transition" />
          </a>
          <a href="https://www.linkedin.com/in/jendyco-international-27647b36b" target="_blank" rel="noopener noreferrer" aria-label="LinkedIn">
            <FaLinkedin className="text-[#0077B5] text-2xl hover:scale-110 transition" />
          </a>
        </div>
        Â© {new Date().getFullYear()} Jendyco International. All rights reserved.
      </footer>
    </div>
  );
}
